import React from 'react';

const Card = () => {
	const Card = styled.div`
		display: flex;
		flex-flow: ${direction} ${wrap};
		justify-content: ${justifyContent};
		align-items: ${alignItems};
		gap: ${4 * spacing || 0}px;
	`;

	return <React.Fragment />;
};

export default Card;
